import React, { Component } from 'react'
import client from '../../client'
import { Footer } from '../../component/major/Footer'
import { Navbar } from '../../component/major/Navbar'

import TutorialModel from './TutorialModel'

export default class Tutorial extends Component {
    constructor() {
        super()
    
        this.state = {
            articles: []
        }
    }
    
    componentDidMount() {
        client.getEntries({content_type: 'tutorial'}).then((response) => {
            this.setState({articles: response.items})
        })
    } 
    
    render() {
        const articles = this.state.articles.map((article, i) => <TutorialModel id={i} key={i} article={article}/>)
        if(!articles){
            return <p>loading</p>
        }
        return (
            <>
                <Navbar/>
                <div className='px-5 md:px-20 lg:px-32'>
                    <p className='poppins-600 text-25 bg-gradient-purple-to-pink text-white px-16 py-16 my-16 rounded-2xl text-left'>Tutorial</p>
                    <div className='grid grid-cols-1 md:grid-cols-2 xl:grid-cols-3 gap-10'>
                        {articles}
                    </div>
                </div>
                <Footer/>
            </>
        )
    }
}
